rido, la cual en comunicacion telefonica con el Comisario Molina Ricardo, director de Escuela Juan Vucetich sede Mar del Plata anoticiandolo del ilicito sufrido por la dicente<br>             <b>Modalidad:</b> <span style="color: darkred; font-weight: bold;">ASALTO, MOTOCHORRO, MOTO(ROBO/HURTO)</span><br>             <b>Lugar:</b>  RUTA 226 KM 110 nan         </div>         </div>`)[0];

                     Que siendo las 21:20hs aprox ve un motovehiculo tipo 150cc de la cual no logra precisar demas detalles, con dos sujetos masculinos el cual uno de ellos vestia camisa tipo leñadora color rojo con blanco y pantalon largo de color claro y del otro sujeto no logra identificarlo, dichos sujetos ingresaron al barrio y aproximadamente 05 minutos despues los mismos regresan en sentido a mar del plata, frenan en la parada del colectivo y el acompañante, el unico que logra divisar vestimenta, se acerca a la dicente se levanta la camisa exhibiendole un arma de fuego al tiempo que le decia que le de todo que la iba a matar. La dicente llevaba puesto un bolso gris marca Nike en el cual en su interior llevaba una billetera negra con tarjetas de Mercado Pago, Uala y una perteneciente al Banco provincia, de la cual remarca que no se trata de la cuenta sueldo y dinero en efectivo no pudiendo precisar la cantidad, ademas de la chomba de color azul con cuello turquesa perteneciente al operativo, una bermuda de fajina azul, un chaleco refractario de Policia, una pistolera y un par de medias blancas. Ademas llevaba consigo una matera y una bolsa de tela con vestimenta particular. Cuando el sujeto se le acerca comienza a tironearle desde el bolso gris marca nike, arrastrandola por el asfalto logrando quitarselo para posteriormente salir corriendo con el otro sujeto que se quedo esperando en la mano de enfrente en el motovehiculo en el cual se movilizaban. Luego de esto la misma se comunica con su progenitora Rodriguez Karina informandole lo ocurrido, la cual en comunicacion telefonica con el Comisario Molina Ricardo, director de Escuela Juan Vucetich sede Mar del Plata anoticiandolo del ilicito sufrido por la dicente
